// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Table from './pages/Table';
import './style.css'; 

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<Table />} />
        {/* Add more routes here */}
      </Routes>
    </Router>
  );
}

export default App;
